import React, { useState } from "react";
import TodoItem from "./TodoItem";

const TodoList = ({ todos }) => {
  return (
    <ol>
      Array.from(todos.entries()).map(([id, {(text, isCompleted)}]) => (
      <TodoItem key={id} text={text} />
    </ol>
  );
};

export default TodoList;
